import { NavLink } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'boxicons';

import Result from '../pages/Result';
import Ajout from '../pages/Ajout';
const Navigation = () => {

    return (
        <div className="p-2 col-2 border border rounded" style={{backgroundColor: 'rgba(45, 57, 75, 1)'}}>
            <div className="sidebar">
                <div className="logo_content">
                    <div className="logo">
                    <box-icon name='notepad'></box-icon>
                        <div className="logo_name">
                            Coding Lab 
                        </div>
                    </div>
                    <box-icon name='menu' id='btn'></box-icon>
                </div>
                <ul className="nav_list">
                    <li>
                        <a href="#">
                        <box-icon name='grid-alt' type='solid' ></box-icon>
                        <span className="links_name">DashBoard</span>
                        </a>
                    </li>
                </ul>
            </div>
        <br /><br />
        <NavLink to="/TemplateAdmin/Ajout"><button type="button" className="btn btn-outline-primary">Ajout de these</button>  </NavLink>
        <br /> <br />
        <NavLink to="/TemplateAdmin/Result"><button type="button" className="btn btn-outline-primary">Gestion des theses</button>  </NavLink>
        <br /><br />
        <NavLink to="/TemplateAdmin/Detail"><button type="button" className="btn btn-outline-primary">Gestion des Utilisateurs</button>  </NavLink>
        <br /><br />
        <NavLink to="/"> <button type="button" className="btn btn-outline-primary">Statistiques</button>  </NavLink>
        <br /><br />
        <NavLink to="/TemplateAdmin/DocumentAValider"> <button type="button" className="btn btn-outline-primary">Listes des documents Ã  valider</button>  </NavLink>
        </div>
        
    );
};

export default Navigation;
